import "./Header.css";
import { Link, Outlet } from "react-router-dom";

const Header = () => {
  return (
    <nav className="header-nav">
      <Link to="/">Logo</Link>
      <div>
        <Link to="/vegetable">Vegetable</Link>
        <Link to="/fruit">Fruit</Link>
      </div>
      <Link to="/contact">Contact</Link>
      <Outlet />
    </nav>
  );
};

export default Header;
